<style>

        padding: 0;

    .container{
        position: relative;

    .default_icon{

        width: 100%;
        height: 100%;
        display: none;
        margin-top: 0%;
        margin-left: 0%;
    }


    .container:hover .default_icon{

    }

    .container:hover .hover_icon{
        display: block;
    }


</style>
